description:
Sisters Of Anarchy (NEW 2014 Digital Playground) (Split Scenes)

Alektra Blue, Ava Addams, Bonnie Rotten, Dahlia Sky, Dana DeArmond, Evan Stone, Jessa Rhodes, Karlo Karrera, Marco Banderas, Misty Stone, Nadia Styles, Prince Yahshua, Seth Gamble, Steven St. Croix, Tommy Gunn, Toni Ribas, Tony Martinez

Jackie, played by Bonnie Rotten, is the leader of the Sisters of Anarchy motorcycle gang who operate in the heart of Briarhaven, California. She has to deal with some difficult decisions involving her club's future ever since ex-gang member, Adam, exchanged information with the feds. Now the district attorney is pining on Adam's testimony to ensure her spot as governor. Every decision Jackie will make will affect her family, friends and rival gangs. In order to protect her hometown and the SOA, Jackie must do what's needed, even if it means screwing people, left and right!

